import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaSearch, FaShoppingCart, FaUser } from 'react-icons/fa';
import './GadgetsPage.css';

const GadgetsPage = () => {
  const navigate = useNavigate();

  const shops = [
    { id: 1, name: 'Gadget Shop', image: '/gadget-shop.jpg' },
    { id: 2, name: 'AppleCom', image: '/apple-com.jpg' },
    { id: 3, name: 'Comfy Store', image: '/comfy-store.jpg' },
    { id: 4, name: 'iShop', image: '/ishop.jpg' }
  ];

  const phones = [
    { id: 1, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' },
    { id: 2, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' },
    { id: 3, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' },
    { id: 4, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' },
    { id: 5, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' }
  ];

  const computers = [
    { id: 1, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' },
    { id: 2, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' },
    { id: 3, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' },
    { id: 4, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' },
    { id: 5, name: 'Name', price: '$15', description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit.' }
  ];

  return (
    <div className="gadgets-page">
      <nav className="navbar">
        <div className="nav-left">
          <ul className="nav-links">
            <li><a onClick={() => navigate('/clothes')}>Clothes</a></li>
            <li><a href="#gadgets">Gadgets</a></li>
            <li><a href="#new">New</a></li>
            <li><a href="#featured">Featured</a></li>
            <li><a href="#barter">Barter</a></li>
          </ul>
        </div>

        <div className="nav-center">
          <h1>TECHSELL</h1>
        </div>

        <div className="nav-right">
          <button className="icon-button"><FaSearch /></button>
          <button className="icon-button"><FaShoppingCart /></button>
          <button className="icon-button"><FaUser /></button>
        </div>
      </nav>

      <div className="content-container">
        <div className="shops-sidebar">
          <h2>Shops</h2>
          {shops.map(shop => (
            <div key={shop.id} className="shop-item">
              <img src={shop.image} alt={shop.name} />
              <p>{shop.name}</p>
            </div>
          ))}
        </div>

        <div className="products-section">
          <section className="phones-section">
            <h2 className="section-title">Phones</h2>
            <div className="products-grid">
              {phones.map(phone => (
                <div key={phone.id} className="product-card">
                  <div className="product-image"></div>
                  <h3>{phone.name}</h3>
                  <p>{phone.description}</p>
                  <span className="price">{phone.price}</span>
                </div>
              ))}
            </div>
          </section>

          <section className="computers-section">
            <h2 className="section-title">Computers</h2>
            <div className="products-grid">
              {computers.map(computer => (
                <div key={computer.id} className="product-card">
                  <div className="product-image"></div>
                  <h3>{computer.name}</h3>
                  <p>{computer.description}</p>
                  <span className="price">{computer.price}</span>
                </div>
              ))}
            </div>
          </section>
        </div>
      </div>
    </div>
  );
};

export default GadgetsPage;
